import React from 'react'

const ProductCard = ({products}) => {
    if(!products) return 'Loadi'
  return (
   <>
    {products.map(product => {
        <div key={product.id} className="card" style={{width: 'max-content', height:"max-content"}}>
         <img className="card-img-top " style={{width: '250px', height:"250px"}} src="https://tinyurl.com/59ynrhkt" alt="Card image cap"/>
              <div className="card-body">
               <h5 className="card-title">{product.ProductName}</h5>
               <h5 > {product.ProductVersion}</h5>
               <h5 > {product.Productprice}</h5>
    
  </div>
</div>

    })}
</>
    
  )
}

export default ProductCard
